import { GeneralDiv } from './StyleFooter'

export default function ContactUsContent() {
  return (
    <GeneralDiv>
        Contact Us:<br/>
        Mail:
        <a href="mailto:Louai-Salem@hotmail.com"> Louai-Salem@hotmail.com</a> <br/><br/><br/>
        Phone : +9726101420

    </GeneralDiv>
  )
}
